import React, { useEffect, useState } from "react";

function App() {
  const [loaded, setLoaded] = useState(false);

  useEffect(() => {
    setTimeout(() => setLoaded(true), 300);
  }, []);

  return (
    <div
      style={{
        backgroundColor: "#000",
        minHeight: "100vh",
        fontFamily: "Poppins, sans-serif",
        color: "#fff",
        overflow: "hidden",
        position: "relative",
      }}
    >
      {/* Moving stars background */}
      <div
        style={{
          position: "absolute",
          inset: 0,
          background:
            "radial-gradient(circle at 20% 20%, rgba(255,215,0,0.05) 0%, transparent 40%), radial-gradient(circle at 80% 80%, rgba(255,215,0,0.05) 0%, transparent 40%)",
          animation: "moveBg 10s infinite alternate",
          zIndex: 0,
        }}
      ></div>

      {/* Animated Content */}
      <div
        style={{
          position: "relative",
          zIndex: 2,
          textAlign: "center",
          paddingTop: "100px",
          opacity: loaded ? 1 : 0,
          transform: loaded ? "translateY(0)" : "translateY(30px)",
          transition: "all 1.5s ease",
        }}
      >
        {/* Logo */}
        <img
          src="/logo.png"
          alt="Target Marketing Logo"
          style={{
            width: "160px",
            marginBottom: "25px",
            filter: "drop-shadow(0 0 30px rgba(255,215,0,0.8))",
            opacity: loaded ? 1 : 0,
            transition: "opacity 2s ease",
          }}
        />

        {/* Title */}
        <h1
          style={{
            fontSize: "3.5rem",
            fontWeight: 800,
            color: "#FFD700",
            textShadow:
              "0 0 25px #FFD700, 0 0 50px rgba(255,215,0,0.6), 0 0 100px rgba(255,215,0,0.4)",
            letterSpacing: "1px",
          }}
        >
          TARGET MARKETING ACADEMY
        </h1>

        {/* Subtitle */}
        <p
          style={{
            fontSize: "1.4rem",
            color: "#eee",
            marginTop: "15px",
            textShadow: "0 0 15px rgba(255,255,255,0.3)",
          }}
        >
          Innovation. Intelligence. Impact.
        </p>

        {/* Description */}
        <p
          style={{
            maxWidth: "700px",
            margin: "25px auto 60px auto",
            color: "#bbb",
            fontSize: "1.1rem",
            lineHeight: "1.8",
          }}
        >
          Explore the <span style={{ color: "#FFD700" }}>GPS</span> ecosystem —{" "}
          <b>Trading</b>, <b>Marketing</b>, <b>Dropshipping</b>,{" "}
          <b>Languages</b>, and <b>Design Studio</b> — where education meets
          innovation powered by <span style={{ color: "#FFD700" }}>AI</span>.
        </p>

        {/* Buttons */}
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            flexWrap: "wrap",
            gap: "20px",
            maxWidth: "900px",
            margin: "0 auto",
          }}
        >
          {[
            "GPS TRADING",
            "GPS MARKETING",
            "GPS DROPSHIPPING",
            "GPS LANGUAGES",
            "GPS STUDIO",
          ].map((item, i) => (
            <button
              key={i}
              style={{
                background:
                  "linear-gradient(135deg, #FFD700 0%, #b8860b 100%)",
                color: "#000",
                border: "none",
                borderRadius: "12px",
                padding: "16px 28px",
                fontWeight: "700",
                cursor: "pointer",
                boxShadow:
                  "0 0 20px rgba(255,215,0,0.3), inset 0 0 10px rgba(255,255,255,0.1)",
                transition: "all 0.4s ease",
              }}
              onMouseOver={(e) => {
                e.target.style.transform = "translateY(-5px) scale(1.05)";
                e.target.style.boxShadow =
                  "0 0 30px rgba(255,215,0,0.8), 0 0 60px rgba(255,215,0,0.5)";
              }}
              onMouseOut={(e) => {
                e.target.style.transform = "translateY(0) scale(1)";
                e.target.style.boxShadow =
                  "0 0 20px rgba(255,215,0,0.3), inset 0 0 10px rgba(255,255,255,0.1)";
              }}
            >
              {item}
            </button>
          ))}
        </div>
      </div>

      {/* Footer */}
      <footer
        style={{
          position: "absolute",
          bottom: "20px",
          width: "100%",
          textAlign: "center",
          color: "#777",
          fontSize: "0.9rem",
          letterSpacing: "0.5px",
        }}
      >
        © 2025 Target Marketing Systems | Powered by GPS AI
      </footer>

      <style>
        {`
          @keyframes moveBg {
            0% { background-position: 0 0, 0 0; }
            100% { background-position: 100px 100px, -100px -100px; }
          }
        `}
      </style>
    </div>
  );
}

export default App;
